import React from 'react';
import "./Home.css";
import { Link } from "react-router-dom";
import bitcoin from "../images/bitcoin.png";
import etherum from "../images/etherum.png";
import realestate from "../images/realestate.jpg"

const Home = () => {
  return (
    <div>
      <h1>Investment Securities</h1>
      <p className='home-first-'>If you want to make money and get richer , invest your money in <span>cryptocurrencies</span>,<span>stocks</span> , <span>real estate</span>, <span>bonds</span>, and <span>other securities</span>. Maybe you may need <span>technical advice</span> on <s>where</s>, <span>how</span> and <span>when</span> to invest. LisaConsult is here for you to make your dream come true. Just click the link below to sign up for the course and you will have an amazing life.</p>
    </div>

  )
}

export default Home
